        <script type="application/json" id="1044">
          {"24568368-4558-409c-8a97-845959ccc5b7":{"roots":{"references":[{"attributes":{"children":[{"id":"1020","type":"Div"},{"id":"1021","type":"Div"}],"margin":[5,5,5,5],"name":"Row00031"},"id":"1019","type":"Row"},{"attributes":{"child":{"id":"1037","type":"Div"},"name":"Markdown00051","title":"References"},"id":"1038","type":"Panel"},{"attributes":{"children":[{"id":"1040","type":"Div"},{"id":"1041","type":"Div"}],"margin":[5,5,5,5],"name":"Row00055"},"id":"1039","type":"Row"},{"attributes":{"child":{"id":"1017","type":"Div"},"name":"Markdown00025","title":"ClinicalTrials.Gov"},"id":"1018","type":"Panel"},{"attributes":{"height":250,"margin":[5,5,5,5],"name":"Markdown00025","sizing_mode":"fixed","text":"&lt;h1&gt;ClinicalTrials.Gov&lt;/h1&gt;\n&lt;h2&gt;ClinicalTrials.Gov now accumulates information from over 300K trials with over 10% reporting results.&lt;/h2&gt;\n&lt;h2&gt;It is now a &lt;a href=\"https://www.gpo.gov/fdsys/pkg/PLAW-110publ85/pdf/PLAW-110publ85.pdf#page=82\"&gt;U.S. Law&lt;/a&gt; to upload clinical trials to this &lt;a href=\"https://clinicaltrials.gov/ct2/resources/trends\"&gt;fast growing database&lt;/a&gt;.&lt;/h2&gt;\n&lt;h2&gt;Data from this database can be extracted in XML format towards modeling.&lt;/h2&gt;\n&lt;h2&gt;However, the database is based on textual input which is suitable for human use rather than computer comprehension.&lt;/h2&gt;\n&lt;h2&gt;One major problem is unit standardization&lt;/h2&gt;\n&lt;table&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n&lt;th align=\"center\"&gt;Time&lt;/th&gt;\n&lt;th align=\"center\"&gt;Number of Trial with Results&lt;/th&gt;\n&lt;th align=\"center\"&gt;Unique Units&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n&lt;td align=\"center\"&gt;20 Apr 2018&lt;/td&gt;\n&lt;td align=\"center\"&gt;30,763&lt;/td&gt;\n&lt;td align=\"center\"&gt;21,094&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n&lt;td align=\"center\"&gt;7 Feb 2019&lt;/td&gt;\n&lt;td align=\"center\"&gt;34,751&lt;/td&gt;\n&lt;td align=\"center\"&gt;23,733&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n&lt;td align=\"center\"&gt;12 Apr 2019&lt;/td&gt;\n&lt;td align=\"center\"&gt;35,926&lt;/td&gt;\n&lt;td align=\"center\"&gt;24,548&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n&lt;h2&gt;Non standardized units prevent machine comprehension of stored numbers.&lt;/h2&gt;\n&lt;h2&gt;If units are standardized, the valuable numerical data in this database can become machine comprehensible.&lt;/h2&gt;","width":1200},"id":"1017","type":"Div"},{"attributes":{"height":440,"margin":[5,5,5,5],"name":"Markdown00046","sizing_mode":"fixed","text":"&lt;p&gt;&lt;a title=\"ClinicalUnitMapping.com web site\" target=\"_blank\" href=\"https://clinicalunitmapping.com/\"&gt;&lt;img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB4AAAAQQCAYAAAADLEYYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsIAAA7CARUoSoAAAP+lSURBVHhe7N0JYBN1+v/xD2e5i5ZLoAKCcmlFFFeLultEQV1kVfAC8cQfuiqesC6I/0VYBY/1WnVXAUXEAy9gURC0uygFRREqICBX5ZBTKXfL9Z9nMmmTkPRMoQ3v1++XTWYmmUwmk1Dzmef5lluZsf6QCqFKXGVVr15VlStVVCXnUqF8eW8JgCPtwMGD2rdvv7Kdy85de5SVle0tAQAAAAAAAAAAwLGoUAHwcbVrqnatGt4UgNJmW+ZO/Za5w5sCAAAAAAAAAADAsabA5bsNG9Qh/AVKudrxNdSwfh1vCgAAAAAAAAAAAMeaAgXAx8XXUFzlSt4UgNIsLq6SGwRHU15tAgrVQx4AAAAAAAAAAAAlKt8A2ILf2vE1vSkAZcFxzme2chRP2ijnXYeT1zIAAAAAAAAAAAAcWfkGwDVrVPNuAShL+OwCAAAAAAAAAAAce/INgCtVqujdAlCWVK5YxM9uNHo60xcaAAAAAAAAAADgqMg3AI5mG1kAR06RT96IRk9n+kIDAAAAAAAAAAAcFfkGwOXLkeQAZVGFCvl+vIOVRNUulcAAAAAAAAAAAABHVCETovwd8gKfgwelAwd80/5rE7jczz8PwFFUEud6cP4IAAAAAAAAAACIspOaNMzzUtqcflorzZmd5k0dzpbZfaIl6gGwFQxboFveWXOFCr5puzY236Yt/LXlgfMIgQEAAAAAAAAAAAAUxMqM9WEvpdE/X/q3br/tprAhsM37v9tv0b/+PdqbU3xRD4At3LVAd/Fi6brrpG7dpFdf9c0z+/f7wt8JE6T77/cFv/4LgNLv748P1+NP/N2bAgAAAAAAAAAAODICK3wDK34D55dG551/gV565bXDQuCvvpyZE/6ec26yN7f4SqQCeNs26fLLpapVpWuuke69Vxo3Lnf5r7/6wt8zz/SFwf7QuGAW6PmUZ7XIm/LZoE/uvFufbPAmI7LHFuR+0tZJd+v8w57HM//ZyMuiYNEznfXApAJsJHAULFmyRD/++KM3BQAAAAAAAAAAcOSEq/q1S2kXGgJb+Htnv9uiHv6aEgmAv/pK2r1beuUVqXdv6YYbpFGjfMutHfTgwdIZZ0i9evnGB7YQuOABcHGcr dquo;hard&amp;rdquo; areas of active physical/conversational problem-solving, are far out on the almost unforeseeable horizon at this point.&lt;/h2&gt;\n&lt;h3&gt;&lt;span style=\"color:green\"&gt; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Jeff Shrager, Director of Research, xCures and Adjunct Professor Symbolic Systems Program Stanford University&lt;/span&gt;&lt;/h3&gt;\n&lt;h2&gt;A: I believe this is already happening, though not explicitly. Currently, patients often look up their symptoms on the internet with inconsistent results.  The challenge for us is to make medical knowledge accessible, understandable and accurate.&lt;/h2&gt;\n&lt;h3&gt;&lt;span style=\"color:green\"&gt; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Rocky Reston, Chief Medical Informatics Officer, Saperi Systems, Inc. &lt;/span&gt;&lt;/h3&gt;\n&lt;h2&gt;A: Technically, we could certainly have a prototype in 5-10 years. The main obstacles will be ethical, professional concerns of reliability and accreditation, philosophical challenges, knowledge management.&lt;/h2&gt;\n&lt;h3&gt;&lt;span style=\"color:green\"&gt; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Olaf Dammann, Professor and Vice Chair, Dept. of Public Health &amp;amp; Community Medicine, Tufts University School of Medicine  &lt;/span&gt;&lt;/h3&gt;\n&lt;p&gt;Quoted text was extracted from email conversations and was edited to fit this presentation&lt;/p&gt;","width":1200},"id":"1013","type":"Div"},{"attributes":{"height":600,"margin":[5,5,5,5],"name":"Markdown00036","sizing_mode":"fixed","text":"&lt;p&gt;&lt;object width=\"600\" height=\"600\" data=\"https://jacob-barhak.github.io/CommonResources/UnitProximityHeatMap.html\"&gt;Warning:https://jacob-barhak.github.io/CommonResources/UnitProximityHeatMap.html could not be included!&lt;/object&gt;&lt;/p&gt;","width":600},"id":"1025","type":"Div"},{"attributes":{"height":220,"margin":[5,5,5,5],"name":"Markdown00032","sizing_mode":"fixed","text":"&lt;h1&gt;Natural Language Processing (NLP)&lt;/h1&gt;\n&lt;h2&gt;Units were evaluated for text proximity using:&lt;/h2&gt;\n&lt;h3&gt;difflib.SequenceMatcher method&lt;/h3&gt;\n&lt;h3&gt;TfidfVectorizer &amp;amp; cosine_similarityfrom scikit-learn&lt;/h3&gt;\n&lt;h2&gt;Overall 5729 unique Auxiliary unit were processed.&lt;/h2&gt;\n&lt;h2&gt;A similarity matrix was constructed.&lt;/h2&gt;\n&lt;h3&gt;Matrix size was 24,548 x (24,548 + 5729)&lt;/h3&gt;","width":600},"id":"1024","type":"Div"},{"attributes":{"height":600,"margin":[5,5,5,5],"name":"Markdown00004","sizing_mode":"fixed","text":"&lt;p&gt;&lt;a title=\"View this presentation on the web\" target=\"_blank\" href=\"https://jacob-barhak.github.io/Presentation_PyConIsrael2019.html\"&gt;&lt;img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAhIAAAISAQAAAACxRhsSAAAEqElEQVR4nO2dTa6jOhCFTz2QMjQ7yFJgZ1HvDJaSBTzJDCOB6g1ctsvp7tuDvvFL3z4MEOHnE0hHZdefI4rf3bZ/fhsBkEEGGWSQQQYZZJBBRmWIbSOAXUSWfUznsMmYb91HYJsAWfZ8//LJ70EGGR8yZlVVjQC26wEgHAAwKBAegm0CgPAQWXCKrhhUVVVbxme8BxlkfMjYzTrKsl8U2EfoCgDz/aJyi4BZ27z5n+/2LWT8DYzwEGzXh8hND4hMp5hio+1k6fIeZJDxc0Ya/Of7RfXbdAoAQJZkXodkaLu8Bxlk+C3LLiiAHQAwqCAcwHwfgXkFZJsgQHiIble7z6cH3uVbyPjyjE1ERCazncA+QpZiQOc4qM1U7yNkwZnc/c9/DzLI+PGmT9uaXX2blapq2tUYwPz0xLt8Cxlfl1F0eiQnKakzjfs18uTUedgTJThFnZLxekZSnUk0HGmM1xXIjlOS4wETZkSeBsSsceqUjJcznE5hZvOwC2u6ejwfASFPA2bqlIwuDNMpgk1Ns2xtoMecB/qkzlkPl7yiPSWjE6OZbcahFWZxnCKQr9rNtKdk/A+MWR8icn1YYF8mQNf9Utx/OwfgFLnFU7zT9WbfQsYXZOSBPvn22YXSmC0mwgFd06zAdsnV0kh/n4xuDDfuVxcqB0xtGook4HDkwT/66Cp1SsbrGU2cPw5mNu3IhGlR0/j0BOenZHRjZJ/JHQ0lTFWCUxElC+BdKOqUjE4MHz9N6sz2FKbYISel8kw1HSXtUqdkdGE0VjSnnZz3pK1OS+iqPkudkvF6RpuPgsub5vgpSqJ08LItcVbqlIxujO1ag1On2OTzfrFzW6qYPkVkylexX9gfRUZnRrKn+2h9fJtIKox29afbVGKq6b4H+03J6MVw/n6NmqYLa3vOUvu14I9xfjK6MVz81E5kZ967UClR5QNWzO+T0ZPh8qaq1d+vTj9K5VQEqlFlnTQZPRnZnsamMDpVTGttNCk/SxB1Zn6fjH6M5/rTXH3SJk+1FqP4hhTqlIxODF9rOpf60zW0O5SoaQRyPT/zpmR0Y3g/aq7HZVCvDX6lDqVpUqFOyejBaPr4Sv3pCiB79H5ZtFxDBdTWFOqUjNcz0noouk2AIPwrmOMEAYYjryIxqMwrFNgn0 lt;h2&gt;&lt;span style=\"color:magenta\"&gt;A major obstacle is standardization! Yet Python can help!&lt;/span&gt;&lt;/h2&gt;\n&lt;h3&gt;Acknowledgments:&lt;/h3&gt;\n&lt;ul&gt;\n&lt;li&gt;Many thanks to the PyViz team:&lt;ul&gt;\n&lt;li&gt;James Bednar who introduced the PyViz tools.&lt;/li&gt;\n&lt;li&gt;Philipp Rudiger for great support of PyViz tools. &lt;/li&gt;\n&lt;li&gt;Jean-Luc Stevens for creating holoviews.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;li&gt;Thanks to John Rice for the fruitful discussions regarding standardization. &lt;/li&gt;\n&lt;li&gt;Thanks to CDISC consortium help&lt;/li&gt;\n&lt;li&gt;Thanks to government persons who helped and specifically to: &lt;ul&gt;\n&lt;li&gt;Nick Ide from NIH/NLM ClinicalTrials.Gov team on advice to process the site&lt;/li&gt;\n&lt;li&gt;Erin E Muhlbradt from NIH/NCI for advice on CDISC unit data&lt;/li&gt;\n&lt;li&gt;John Garguilo from NIST  for information on RTMMS&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;li&gt;Thanks to Paul Schluter for information about RTMMS and the IEEE unit standard&lt;/li&gt;\n&lt;li&gt;Thanks for Tipton Cole, Rocky Reston, Andrew Simms for useful directions&lt;/li&gt;\n&lt;/ul&gt;","width":600},"id":"1040","type":"Div"},{"attributes":{"height":600,"margin":[5,5,5,5],"name":"Markdown00044","sizing_mode":"fixed","text":"&lt;h1&gt;Web Site Key Points&lt;/h1&gt;\n&lt;h3&gt;A web site was created to allow collaborative unit mapping&lt;/h3&gt;\n&lt;h3&gt;The web site is accessible thought &lt;a href=\"https://clinicalunitmapping.com/\"&gt;ClinicalUnitMapping.com&lt;/a&gt;&lt;/h3&gt;\n&lt;h2&gt;Developments:&lt;/h2&gt;\n&lt;h3&gt;The units were stored in a SQLite3 relational database&lt;/h3&gt;\n&lt;h3&gt;The web site was developed using the Flask library&lt;/h3&gt;\n&lt;h3&gt;A reduced database was used for demonstration purposes&lt;/h3&gt;\n&lt;h3&gt;An administration system allows multiple user management&lt;/h3&gt;\n&lt;h2&gt;User support:&lt;/h2&gt;\n&lt;h3&gt;Similar units clustered together and user can switch clusters&lt;/h3&gt;\n&lt;h3&gt;Unit context and statistics displayed&lt;/h3&gt;\n&lt;h3&gt;User can map units using user or machine  suggested units&lt;/h3&gt;\n&lt;h3&gt;Highlighted auxiliary units: RTMMS / CDISC / UCUM / Unit Ontology&lt;/h3&gt;","width":500},"id":"1033","type":"Div"},{"attributes":{"child":{"id":"1013","type":"Div"},"name":"Markdown00021","title":"Opinions 1"},"id":"1014","type":"Panel"},{"attributes":{"child":{"id":"1027","type":"Row"},"name":"Row00043","title":"Machine Learning"},"id":"1030","type":"Panel"},{"attributes":{"code":"\nif (!window.PyViz) {\n  return;\n}\nvar receiver = window.PyViz.receivers['1001'];\nvar events = receiver ? receiver._partial.content.events : [];\nfor (var event of events) {\n  if ((event.kind == 'ModelChanged') &amp;&amp; (event.attr == 'active') &amp;&amp;\n      (cb_obj.id == event.model.id) &amp;&amp;\n      (cb_obj['active'] == event.new)) {\n    events.pop(events.indexOf(event))\n    return;\n  }\n}\n\ndata = {active: cb_obj['active'], 'id': cb_obj.id};\n\nfunction unique_events(events) {\n  // Processes the event queue ignoring duplicate events\n  // of the same type\n  var unique = [];\n  var unique_events = [];\n  for (var i=0; i&lt;events.length; i++) {\n    var _tmpevent = events[i];\n    event = _tmpevent[0];\n    data = _tmpevent[1];\n    if (unique_events.indexOf(event)===-1) {\n      unique.unshift(data);\n      unique_events.push(event);\n      }\n  }\n  return unique;\n}\n\nfunction process_events(comm_status) {\n  // Iterates over event queue and sends events via Comm\n  var events = unique_events(comm_status.event_buffer);\n  for (var i=0; i&lt;events.length; i++) {\n    var data = events[i];\n    var comm = window.PyViz.comms[data[\"comm_id\"]];\n    comm.send(data);\n  }\n  comm_status.event_buffer = [];\n}\n\nfunction on_msg(msg) {\n  // Receives acknowledgement from Python, processing event\n  // and unblocking Comm if event queue empty\n  var metadata = msg.metadata;\n  var comm_id = metadata.comm_id\n  var comm_status = window.PyViz.comm_status[comm_id];\n  if (comm_status.event_buffer.length) {\n    process_events(comm_status);\n    comm_status.blocked = true;\n    comm_status.time = Date.now()+50;\n  } else {\n    comm_status.blocked = false;\n  }\n  comm_status.event_buffer = [];\n  if ((metadata.msg_type == \"Ready\") &amp;&amp; metadata.content) {\n    console.log(\"Python callback returned following output:\", metadata.content);\n  } else if (metadata.msg_type == \"Error\") {\n    console.log(\"Python failed with the following traceback:\", metadata.traceback)\n  }\n}\n\n// Initialize Comm\nif ((window.PyViz == undefined) || (window.PyViz.comm_manager == undefined)) { return }\ncomm = window.PyViz.comm_manager.get_client_comm(\"1001\", \"9ac426b87c2f4631bf3483ec734b458e\", on_msg);\nif (!comm) {\n  return\n}\n\n// Initialize event queue and timeouts for Comm\nvar comm_status = window.PyViz.comm_status[\"9ac426b87c2f4631bf3483ec734b458e\"];\nif (comm_status === undefined) {\n  comm_status = {event_buffer: [], blocked: false, time: Date.now()}\n  window.PyViz.comm_status[\"9ac426b87c2f4631bf3483ec734b458e\"] = comm_status\n}\n\n// Add current event to queue and process queue if not blocked\nevent_name = cb_obj.event_name\ndata['comm_id'] = \"9ac426b87c2f4631bf3483ec734b458e\";\ntimeout = comm_status.time + 20000;\nif ((comm_status.blocked &amp;&amp; (Date.now() &lt; timeout))) {\n  comm_status.event_buffer.unshift([event_name, data]);\n} else {\n  comm_status.event_buffer.unshift([event_name, data]);\n  setTimeout(function() { process_events(comm_status); }, 50);\n  comm_status.blocked = true;\n  comm_status.time = Date.now()+50;\n}\n"},"id":"1043","type":"CustomJS"},{"attributes":{"child":{"id":"1039","type":"Row"},"name":"Row00055","title":"Summary"},"id":"1042","type":"Panel"},{"attributes":{"children":[{"id":"1028","type":"Div"},{"id":"1029","type":"Div"}],"margin":[5,5,5,5],"name":"Row00043"},"id":"1027","type":"Ro /h3&gt;\n&lt;h2&gt;3. Use python tools to:&lt;/h2&gt;\n&lt;h3&gt;- Link between units using Machine Learning and NLP&lt;/h3&gt;\n&lt;h3&gt;- Create a web site for crowd mapping of the unit corpus&lt;/h3&gt;\n&lt;h2&gt;4. In the future this mapping will allow machines to comprehend units&lt;/h2&gt;","width":500},"id":"1020","type":"Div"},{"attributes":{"children":[{"id":"1024","type":"Div"},{"id":"1025","type":"Div"}],"margin":[5,5,5,5],"name":"Row00038"},"id":"1023","type":"Row"},{"attributes":{"child":{"id":"1019","type":"Row"},"name":"Row00031","title":"Method"},"id":"1022","type":"Panel"},{"attributes":{"height":40,"margin":[5,5,5,5],"name":"Markdown00015","sizing_mode":"fixed","text":"&lt;p&gt;by: &lt;a href=\"http://sites.google.com/site/jacobbarhak/\"&gt;Jacob Barhak&lt;/a&gt;&lt;/p&gt;","width":200},"id":"1010","type":"Div"},{"attributes":{"height":600,"margin":[5,5,5,5],"name":"Markdown00041","sizing_mode":"fixed","text":"&lt;p&gt;&lt;object width=\"900\" height=\"600\" data=\"https://jacob-barhak.github.io/CommonResources/UnitClusterImage_max_linear_400.html\"&gt;Warning:https://jacob-barhak.github.io/CommonResources/UnitClusterImage_max_linear_400.html could not be included!&lt;/object&gt;&lt;/p&gt;","width":900},"id":"1029","type":"Div"},{"attributes":{"height":600,"margin":[5,5,5,5],"name":"Markdown00039","sizing_mode":"fixed","text":"&lt;h1&gt;Machine Learning&lt;/h1&gt;\n&lt;h3&gt;To allow the user to see similar units together, scikit-learn unsupervised machine learning was used.&lt;/h3&gt;\n&lt;h3&gt;Clustering was performed multiple times with different similarity measures to create 130 clusters.&lt;/h3&gt;\n&lt;h3&gt;The top images show the proximity matrix before and after clustering at different stages of the algorithm.&lt;/h3&gt;\n&lt;h3&gt;The green bars show distance from cluster centers. Dark means distant.&lt;/h3&gt;\n&lt;h3&gt;The red bars show the cluster number for each unit.&lt;/h3&gt;\n&lt;h3&gt;The images after clustering visually show the organizing effect of clustering.&lt;/h3&gt;\n&lt;h3&gt;Such interactive visualization is possible through &lt;a href=\"http://pyviz.org/\"&gt;PyViz technologies&lt;/a&gt;.&lt;/h3&gt;","width":300},"id":"1028","type":"Div"},{"attributes":{"height":1000,"margin":[5,5,5,5],"name":"Markdown00051","sizing_mode":"fixed","text":"&lt;h2&gt;Reproducibility:&lt;/h2&gt;\n&lt;p&gt;This presentation is accessible &lt;a href=\"https://jacob-barhak.github.io/Presentation_PyConIsrael2019.html\"&gt;here&lt;/a&gt;. The code that generated the presentation can be accessed &lt;a href=\"https://github.com/Jacob-Barhak/Presentations/tree/master/PyConIsrael2019\"&gt;here&lt;/a&gt;.&lt;/p&gt;\n&lt;p&gt;This presentation is generated using Python 2.7.16, panel-0.5.1, bokeh-1.1.0. with the exception of clustering images produced on Python 3.7.3 , numpy 1.16.3, matplotlib 3.0.3, holoviews 1.12.1, bokeh 1.1.0, panel 0.5.1.&lt;/p&gt;\n&lt;p&gt;Clinical Unit Mapping : Code and data for this work are archived in the file: AnalyzeCT_2019_05_13_Sup_2019_05_31.zip. Web site database was created using the database PartUnitsDB_2019_05_13.db ,  StudiesWithResults_Downloaded_2019_04_12.zip. &lt;/p&gt;\n&lt;p&gt;BioPortal Unit Ontology downloaded on 2019_04_09, CDISC data downloaded on 2019_03_30 , RTMMS units downloaded on 2019_03_24 .  &lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;h2&gt;Publications:&lt;/h2&gt;\n&lt;ul&gt;\n&lt;li&gt;J. Barhak, The Reference Model Models ClinicalTrials.Gov. [SummerSim 2017 July 9-12, Bellevue, WA].(https://doi.org/10.22360/SummerSim.2017.SCSC.022)&lt;/li&gt;\n&lt;li&gt;J. Barhak, The Reference Model: A Decade of Healthcare Predictive Analytics with Python, PyTexas 2017, Nov 18-19, 2017, Galvanize, Austin TX. &lt;a href=\"https://youtu.be/Pj_N4izLmsI\"&gt;Video&lt;/a&gt;&lt;/li&gt;\n&lt;li&gt;J. Barhak, C. Myers, L. Watanabe, L. Smith, M. J. Swat , Healthcare Data and Models Need Standards. Simulation Interchangeability Standards Organization (SISO) 2018 Fall Innovation Workshop.  9-14 Sep 2018 Orlando, Florida &lt;a href=\"https://www.sisostds.org/DesktopModules/Bring2mind/DMX/API/Entries/Download?Command=Core_Download&amp;amp;EntryId=47969&amp;amp;PortalId=0&amp;amp;TabId=105\"&gt;Presentation&lt;/a&gt;&lt;/li&gt;\n&lt;li&gt;J. Barhak, Python Based Standardization Tools for ClinicalTrials.Gov. Combine 2018 . Boston University &lt;a href=\"http://co.mbine.org/system/files/COMBINE_2018_Barhak.pdf\"&gt;Poster&lt;/a&gt;&lt;/li&gt;\n&lt;li&gt;J. Barhak, J. Schertz, Clinical Unit Mapping for Standardization of ClinicalTrials.Gov . MSM/IMAG meeting. IMAG Multiscale Modeling (MSM) Consortium Meeting March 6-7, 2019 @ NIH, Bethesda, MD . &lt;a href=\"https://jacob-barhak.github.io/InteractivePoster_MSM_IMAG_2019.html\"&gt;Poster&lt;/a&gt;&lt;/li&gt;\n&lt;li&gt;J. Barhak, Clinical Data Modeling with Python, AnacondaCon , Austin, Texas,  April 3-5, 2019. &lt;a href=\"https://youtu.be/fQIYMf5wKGE\"&gt;Video&lt;/a&gt; , &lt;a href=\"https://jacob-barhak.github.io/AnacondaCon_2019.html\"&gt;Presentation&lt;/a&gt; &lt;/li&gt;\n&lt;/ul&gt;","width":1200},"id":"1037","type":"Div"},{"attributes":{"child":{"id":"1031","type":"Row"},"name":"Row00048","title":"ClinicalUnitMapping.com"},"id":"1034","type":"Panel"},{"attributes":{"height":20,"margin":[5,5,5,5],"name":"Markdown00013","sizing_mode":"fixed","text":"&lt;h2&gt;Motivation: Computer Automation of Human Reasoning&lt;/h2&gt;","width":1000},"id":"1009","type":"Div"},{"attributes":{"children":[{"id":"1009","type":"Div"},{"id":"1010","type":"Div"}],"margin":[0,0,0,0],"name":"Row00017"},"id":"1008","type":"Row"},{"attributes":{"children":[{"id":"1008","type":"Row"},{"id":"1011","type":"Div"}],"margin":[5,5,5,5],"name":"Column00020"},"id":"1007","type":"Column"},{"attributes":{"callback":null,"js_property_callbacks":{"change:active":[{"id":"1043","type":"CustomJS"}]},"margin":[0,0,0,0],"name":"Tabs00056","tabs":[{"id":"1012","type":"Panel"},{"id":"1014","type":"Panel"},{"id":"1016","type":"Pa
